import { Modal, Form, Input, InputNumber } from "antd";

const CustomModal = ({
  visible,
  onCancel,
  editOneData,
  editSecondData,
  editThirdData,
  editFourthData,
  labelOne,
  labelTwo,
  labelThree,
  labelFour,
  nameOne,
  nameTwo,
  nameThree,
  nameFour,
  editData
}) => {
  const [newdata, setNewData] = useState(editData);

  const onhandleAdd = item => {
    console.log(item);
    // const orginaldata = { ...item };
    // try {
    //   await updateDishes(data);
    // } catch (error) {
    //   // setEditData(orginaldata);
    // }
  };

  return (
    <Modal
      onOk={onhandleAdd(editData)}
      centered
      closable={false}
      visible={visible}
      onCancel={onCancel}
    >
      <Form
        hideRequiredMark={true}
        // initialValues={{
        //   name: editOneData,
        //   price: editSecondData,
        //   type: editThirdData,
        //   date: editFourthData
        // }}
      >
        <Form.Item
          label={labelOne}
          name={nameOne}
          rules={[
            {
              required: true,
              message: `Please input${labelOne}!`
            }
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label={labelTwo}
          name={nameTwo}
          rules={[
            {
              required: true,
              message: `Please input ${labelTwo}!`
            }
          ]}
        >
          <InputNumber />
        </Form.Item>
        <Form.Item
          label={labelThree}
          name={nameThree}
          rules={[
            {
              required: true,
              message: `Please input ${labelThree}!`
            }
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label={labelFour}
          name={nameFour}
          rules={[
            {
              required: true,
              message: `Please input ${labelFour}!`
            }
          ]}
        >
          <Input />
        </Form.Item>
      </Form>
    </Modal>
  );
};

export default CustomModal;
